import Vue from 'vue'
import App from './App.vue'

Vue.config.productionTip = false

import './assets/css/base.css'
import './assets/js/font.js'

import router from './plugins/router.js'

import  './plugins/axios.js'
import '../filters'
let vm =new Vue({
	data:{
		bNav:true,
		bFoot:true,
		bLoading:false
	},

  render: h => h(App),
  router
}).$mount('#app');

export default vm;
